import {
  ResponsiveContainer,
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
} from "recharts";
import { useState, useMemo } from "react";
import { Button } from "./ui/button";
import { Label } from "@/ui/label";
import { Select, SelectTrigger, SelectValue, SelectContent, SelectItem } from "@/ui/select";

interface CommitData {
  date: string; // Format: YYYY-MM-DD
  count: number;
}

interface CommitChartProps {
  data: CommitData[];
}

const CommitChart: React.FC<CommitChartProps> = ({ data }) => {
  const years = useMemo(() => {
    const uniqueYears = new Set<string>();
    data.forEach(({ date }) => {
      uniqueYears.add(date.slice(0, 4)); // 'YYYY'
    });
    return Array.from(uniqueYears).sort();
  }, [data]);

  const [view, setView] = useState<"daily" | "monthly">("daily");
  const [selectedYear, setSelectedYear] = useState<string>(years[0]);

  const toggleView = () => {
    setView((prev) => (prev === "daily" ? "monthly" : "daily"));
  };

  const filteredData = useMemo(() => {
    return data.filter((d) => d.date.startsWith(selectedYear));
  }, [data, selectedYear]);

  const monthlyData = useMemo(() => {
    const monthMap: Record<string, number> = {};

    filteredData.forEach(({ date, count }) => {
      const month = date.slice(0, 7); // 'YYYY-MM'
      monthMap[month] = (monthMap[month] || 0) + count;
    });

    const months = Array.from({ length: 12 }, (_, i) => {
      const month = `${selectedYear}-${String(i + 1).padStart(2, "0")}`;
      return {
        date: month,
        count: monthMap[month] || 0,
      };
    });

    return months;
  }, [filteredData, selectedYear]);

  const dailyData = useMemo(() => {
    const dailyMap: Record<string, number> = {};
    filteredData.forEach(({ date, count }) => {
      dailyMap[date] = (dailyMap[date] || 0) + count;
    });

    const allDates: { date: string; count: number }[] = [];
    const start = new Date(`${selectedYear}-01-01`);
    const end = new Date(`${selectedYear}-12-31`);

    for (let d = new Date(start); d <= end; d.setDate(d.getDate() + 1)) {
      const dateStr = d.toISOString().split("T")[0];
      allDates.push({
        date: dateStr,
        count: dailyMap[dateStr] || 0,
      });
    }

    return allDates;
  }, [filteredData, selectedYear]);

  return (
    <div className="mt-6 space-y-4">
      <div className="flex items-center justify-between gap-2">
        <h2 className="text-lg font-semibold">
          {view === "daily" ? "Daily Commits (Bar Chart)" : "Monthly Commits"}
        </h2>
        <div className="flex gap-2 items-center">
          <Label>Select Year:</Label>
          <Select value={selectedYear} onValueChange={setSelectedYear}>
            <SelectTrigger className="w-[120px]">
              <SelectValue placeholder="Select year" />
            </SelectTrigger>
            <SelectContent>
              {years.map((year) => (
                <SelectItem key={year} value={year}>
                  {year}
                </SelectItem>
              ))}
            </SelectContent>
          </Select>
          <Button variant="outline" onClick={toggleView}>
            Switch to {view === "daily" ? "Monthly" : "Daily"}
          </Button>
        </div>
      </div>

      <ResponsiveContainer width="100%" height={350}>
        <BarChart data={view === "daily" ? dailyData : monthlyData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="date" hide={view === "daily"} />
          <YAxis allowDecimals={false} />
          <Tooltip />
          <Bar dataKey="count" fill="#4f46e5" />
        </BarChart>
      </ResponsiveContainer>
    </div>
  );
};

export default CommitChart;
